import React, { Component } from 'react'
import { connect } from 'react-redux'

class CityCard extends Component {
    render() {
        const { city } = this.props
        return (
            <div className="flex-conatiner">
                <div className="city-card">
                    <h2>{city.name}</h2>
                </div>

            </div>
        )
    }
}

export default CityCard;
